import { useSelector } from 'react-redux';
import Table from './Table/Table';

const TableList = () => {
  const tables = useSelector(state => state.tables);
  <ul>
    {tables.map((table) => (
      <Table key={table.id} id={table.id} status={table.status} />))}
  </ul>


}
export default TableList;
